import React from "react";

export default function Card(props) {

  function capsFirstLetter() {
    const propsName = props.item.name;
    return cappedFirstLetter = propsName.charAt(0).toUppercase() + propsName.slice(1);
  }

  return (
    <div className="card">
      <img className="card-image" src={props.item.img}/>
      <div className="card-descriptor">
        <div className="card-name">{capsFirstLetter}</div>
        <div className="card-muscles">
          {props.item.muscles.map(muscle => <div className="muscle">{muscle}</div>)}
        </div>
      </div>
    </div>
  )
}
